/*
=========================================================
* Material Kit 2 React - v2.0.0
=========================================================

* Product Page: https://www.creative-tim.com/product/material-kit-react
* Copyright 2021 Creative Tim (https://www.creative-tim.com)

Coded by www.creative-tim.com

 =========================================================

* The above copyright notice and this permission notice shall be included in all copies or substantial portions of the Software.
*/

// @mui material components
import Container from "@mui/material/Container";
import Grid from "@mui/material/Grid";

// Material Kit 2 React components
import MKBox from "components/MKBox";
import MKTypography from "components/MKTypography";

// Material Kit 2 React examples
import HorizontalTeamCard from "examples/Cards/TeamCards/HorizontalTeamCard";

import { Card, CardContent, Typography, CardActions, Button, CardHeader } from '@mui/material';


// Images
import team1 from "assets/images/team1.jpg";
import team2 from "assets/images/team2.jpeg";
import team3 from "assets/images/team3.jpeg";
import team4 from "assets/images/team4.jpeg";
import team5 from "assets/images/team5.png";
import team6 from "assets/images/team6.jpg";
import team7 from "assets/images/team7.jpg";

function Team() {
  const imgCard = {
    width: "100%",
    height: "25%",
    borderRadius: 10
  }

  return (
    <MKBox
      component="section"
      backgroundColor="success"
      position="relative"
      py={6}
      px={{ xs: 2, lg: 0 }}
      mx={-2}
    >
      <Container>
        <Grid container>
          <Grid item xs={12} md={0} sx={{ mb: 12 }}>
            <MKTypography variant="h2" color="dark" sx={{ textAlign: 'center', mb: 3 }}>
              CONVENIOS Y COLABORACIÓN
            </MKTypography>
            <MKTypography variant="body1" color="dark" opacity={0.8} sx={{ textAlign: 'center' }}>
              Actualmente, contamos con los siguientes convenios con empresas y organizaciones de caracter público y privado.
            </MKTypography>
          </Grid>
        </Grid>
        <Grid container spacing={2}>
          <Grid item xs={12} sm={10} md={10} lg={6}>
            <MKBox mb={5}>
            <Card>
              <CardHeader
                avatar={
                  <img src={team1} alt="Descripción de la imagen"  style={imgCard} />
                }
                title={<Typography variant="h4" color="textSecondary" component="p">
                MC.CARLOS FELIX CONTRERAS{" "}
              </Typography>}
                subheader={<Typography variant="h5" color="blue" component="p">
               Nutriólogo{" "}
              </Typography>}
              />
              <CardContent>
                <Typography variant="h5" color="textSecondary" component="p">
                  Tel: (618) 1-27-66-37{" "}
                </Typography>{" "}
                <Typography variant="h5" color="textSecondary" component="p">
                Dirección: Las Palmas 218, Fracc. Los Álamos., Durango, Mexico{" "}
                </Typography>{" "}
              </CardContent>{" "}
              <CardActions>
                <Button size="small">Ir a úbicación </Button>{" "}
                <Button size="small">Ir a sitio web</Button>{" "}
              </CardActions>{" "}
            </Card>{" "}
            </MKBox>
          </Grid>
          <Grid item xs={12} lg={10}>
            <MKBox mb={1}>
            <Card>
              <CardHeader
                avatar={
                  <img src={team2} alt="Descripción de la imagen" height="150" style={imgCard} />
                }
                title={<Typography variant="h3" color="textSecondary" component="p">
                MC.LILIANA BUSTAMANTE{" "}
              </Typography>}
                subheader={<Typography variant="h5" color="blue" component="p">
               Psicóloga y docente{" "}
              </Typography>}
              />
              <CardContent>
                <Typography variant="h4" color="textSecondary" component="p">
                Tel: (618) 8-23-14-60{" "}
                </Typography>{" "}
                <Typography variant="h4" color="textSecondary" component="p">
                Dirección: Las Palmas 218, Fracc. Los Álamos., Durango, Mexico{" "}
                </Typography>{" "}
              </CardContent>{" "}
              <CardActions>
                <Button size="small"> Acción 1 </Button>{" "}
                <Button size="small"> Acción 2 </Button>{" "}
              </CardActions>{" "}
            </Card>{" "}
            </MKBox>
          </Grid>
          <Grid item xs={12} lg={6}>
            <MKBox mb={{ xs: 1, lg: 0 }}>
              <HorizontalTeamCard
                image={team3}
                name="UNIVERSO ÓPTICO"
                position={{ color: "info", label: "Optometrista" }}
                description="Tel: (618) 1-54-52-76"
              />
            </MKBox>
          </Grid>
          <Grid item xs={12} lg={6}>
            <MKBox mb={{ xs: 1, lg: 0 }}>
              <HorizontalTeamCard
                image={team4}
                name="CLINICA SANTA ELENA"
                position={{ color: "info", label: "Servicios hospitalarios" }}
                description="Tel: "
              />
            </MKBox>
          </Grid>
          <Grid item xs={12} lg={6}>
            <MKBox mb={{ xs: 1, lg: 0 }}>
              <HorizontalTeamCard
                image={team5}
                name="LABORATORIOS RIVERA"
                position={{ color: "info", label: "Laboratorio de estudios clínicos" }}
                description="Tel: (618) 4-54-02-35"
              />
            </MKBox>
          </Grid>
          <Grid item xs={12} lg={6}>
            <MKBox mb={{ xs: 1, lg: 0 }}>
              <HorizontalTeamCard
                image={team6}
                name="CENTRO H&T"
                position={{ color: "info", label: "Centro de ultrasonido y diagnóstico" }}
                description="Tel: (618) 1-44-27-38"
              />
            </MKBox>
          </Grid>
          <Grid item xs={12} lg={6}>
            <MKBox mb={{ xs: 1, lg: 0 }}>
              <HorizontalTeamCard
                image={team7}
                name="DENTAREA"
                position={{ color: "info", label: "Clínica dental" }}
                description="Tel: (618) 8-11-34-16"
              />
            </MKBox>
          </Grid>
        </Grid>
      </Container>
    </MKBox>
  );
}

export default Team;
